description:
Adapted from a true story, The Tin Mine describes a young boy&amp;#039;s life and destiny that brought him the unforgetable experience. After being retired from a famous university, Arjin Panjapak was only 22 years old. Though he had to end up his life in the university, he simply found a new beginning to learn the real meaning of life when he left the civilize city to somewhere far away. He settled in a tin mine where he met his foreign boss and started to learn many lessons of life.

